Fleischwurst 40 % (Schweinefleisch, Wasser, Speck, Speisesalz, Dextrose, Gewürze, Stabilisator: Natriumcitrate; Antioxidationsmittel: Ascorbinsäure, Natriumascorbat;
Farbstoff: Echtes Karmin), Rapsöl, Gurken 16 %, Wasser, Zucker, SAHNE, EIGELB, Schnittlauch, Petersilie, Dill, Kresse, Kerbel, Sauerampfer, Rauke, Basilikum, Gewürze, Speisesalz, SENFSAAT, Maisstärke, glutenfreie WEIZENSTÄRKE,
Branntweinessig, Säureregulator: Natriumacetate; Dextrose, Verdickungsmittel: Guarkernmehl, Xanthan, Johannisbrotkernmehl.

HERING** ohne Haut 40 %, Rapsöl, Wasser, Gurken, Rote Bete 8 %, SELLERIE, Zwiebeln, Zucker, Äpfel, EIGELB, Gewürze, Speisesalz, SENFSAAT, Maisstärke, modifizierte Maisstärke, Branntweinessig, Säureregulator: Natriumacetate; Dextrose, Maltodextrin, Verdickungsmittel: Guarkernmehl, Xanthan, Johannisbrotkernmehl;
Konservierungsstoffe: Kaliumsorbat, Natriumbenzoat; Rote Betesaftkonzentrat, Aroma.
**Clupea harengus gefangen in der Norwegischen See und Nordsee mit Ringwaden und Pelagischen Scherbrettnetzen.

Fleischbrät 34 % (Schweinefleisch, Wasser, Speck, Kartoffelstärke, Speisesalz, Gewürze, Gewürzextrakte, Dextrose, Stabilisatoren: Natriumcitrate, Natriumacetate, Diphosphate; Emulgator: Citronensäureester von Mono- und Diglyceriden von Speisefettsäuren; Glukosesirup, Säuerungsmittel: Citronensäure; Antioxidationsmittel: Ascorbinsäure, Natriumascorbat; färbendes Lebensmittel: Rote Betesaftkonzentrat; Konservierungsstoff: Natriumnitrit), Rapsöl, Wasser, Gurken 16 %, Zucker, Maisstärke, EIGELB, Gewürze, Speisesalz, SENFSAAT, modifizierte Maisstärke, Branntweinessig, Säureregulator: Natriumacetate; Dextrose,
Verdickungsmittel: Guarkernmehl, Xanthan, Johannisbrotkernmehl;
Konservierungsstoffe: Kaliumsorbat, Natriumbenzoat.
